/Users/allen/Projects/htdocs/webriqpage-.query:
query BlogPostBySlug(
  $slug: String!
) {
  site {
    siteMetadata {
      title
      author
    }
  }
  markdownRemark(fields: {slug: {eq: $slug}}) {
    id
    excerpt(pruneLength: 160)
    html
    frontmatter {
      title
      date(formatString: "MMMM DD, YYYY")
      author
    }
  }
}

